from Crypto.Util.number import getPrime, isPrime, bytes_to_long
import random

sub = list(range(10))
random.shuffle(sub)
print(sub)

while True:
    p = getPrime(512)
    q = int("".join([str(sub[int(x)]) for x in str(p)]))
    if isPrime(q):
        break
n = p * q
print(n)
flag = open("flag.txt").read().strip()
c = pow(bytes_to_long(flag.encode()), 65537, n)
print(c)

